class Solution {

    /**
     * @param String $s1
     * @param String $s2
     * @param String $s3
     * @return Integer
     */
    function findMinimumOperations($s1, $s2, $s3) {
        // Find the shortest string's length because that's the maximum possible length they can all be equal to.
        $minLength = min(strlen($s1), strlen($s2), strlen($s3));

        // Trim all strings to the length of the shortest string.
        $s1 = substr($s1, 0, $minLength);
        $s2 = substr($s2, 0, $minLength);
        $s3 = substr($s3, 0, $minLength);

        // Check if they are all equal after trimming, if so, return the total operations needed.
        if ($s1 == $s2 && $s2 == $s3) {
            return (strlen($s1) - strlen($s1)) + (strlen($s2) - strlen($s1)) + (strlen($s3) - strlen($s1));
        }

        // If not, decrease the minLength and check again until minLength is 0 or strings are equal.
        while ($minLength > 0) {
            $minLength--;
            $s1 = substr($s1, 0, $minLength);
            $s2 = substr($s2, 0, $minLength);
            $s3 = substr($s3, 0, $minLength);

            if ($s1 == $s2 && $s2 == $s3) {
                return (strlen($s1) - $minLength) + (strlen($s2) - $minLength) + (strlen($s3) - $minLength);
            }
        }

        // If it's not possible to make them equal, return -1.
        return -1;
    }
}
